--
-- Events
--
CREATE DEFINER=`root`@`localhost` EVENT `CHK` ON SCHEDULE EVERY 1 DAY STARTS '2024-04-10 22:58:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    DECLARE NEW_ID INT;
    DECLARE REP DATETIME DEFAULT CURRENT_TIMESTAMP;
    DECLARE done BOOLEAN DEFAULT FALSE;
    DECLARE MY_CURSOR CURSOR FOR SELECT ID, LAST_REPORT_ON FROM user WHERE LAST_REPORT_ON + INTERVAL 30 DAY <= CURRENT_TIMESTAMP;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    OPEN MY_CURSOR;
    MY_LOOP: LOOP
        FETCH MY_CURSOR INTO NEW_ID, REP;
        IF done THEN
            LEAVE MY_LOOP;
        END IF;
        CALL INSERT_REP(NEW_ID, REP, REP + INTERVAL 30 DAY);
        UPDATE USER SET LAST_REPORT_ON = REP + INTERVAL 30 DAY WHERE ID = NEW_ID;
    END LOOP;
    CLOSE MY_CURSOR;
END$$

